import React from 'react';
import './percent-ring.scss';

export default class PercentRing extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            percent: props.percent,
            width: 300,
            stroke: 16
        }
    }

    render () {
        return <svg
        class="progress-ring"
        width="300"
        height="300">
       <circle
         class="progress-ring__circle"
         stroke="#333333"
         stroke-width={ this.state.stroke }
         fill="transparent"
         r={ this.state.width / 2 - 2 * this.state.stroke }
         cx={ this.state.width / 2 }
         cy={ this.state.width / 2 } />
     </svg>

    }
}
